import React from 'react';
import './Header.css';

const Header = ({onAdd}) => {
    return (
        <div className='header'>
           <div className='title'>
           <h1>forMe Diary</h1> 
           </div>
           <div className="main-btn">
           <button onClick={onAdd} className="btn">Write Your Story!</button>
           </div>
        </div>
    )
}

export default Header;
